import logo from "./logo.svg";
import "./App.css";

function App() {
  return <List />;
}

function List() {
  let toDo = ["laundry", "coding"];

  return (
    <ul>
      {toDo.map(function (item) {
        <li key={item}>{item}</li>;
      })}
    </ul>
  );
}

export default App;
